        super(props);
        this.state = {
            words: []
        }
        this.words = [];
        this.x = ''
    }
    componentDidMount(){
        axios.get('http://localhost:5001/api/api')
            .then((response) => {
                this.setState( state => ({
                    ...state,
                    words: this.state.words.concat(response.data.words)
                }))
            })
